INSERT INTO `services` (`id`, `title`, `slug`, `description`, `icon`, `services_info`, `featured_image`, `display_order`, `status`, `created_at`, `updated_at`) VALUES
(1, 'Video Production (Pre-Post Online)', 'video-production-pre-post-online', 'How We Help SaaS: Convert complex product features into engaging explainer videos, customer testimonials, and demo videos that increase trial signups and reduce churn through better onboarding.', 'fa-solid fa-video', '[\"Product demo videos (30-90 seconds)\",\"Explainer & tutorial videos\",\"Customer testimonial collection & editing\",\"Founder\\/team interview videos\",\"Social media short-form content (Reels\",\"Shorts)\",\"Video SEO & thumbnail optimization\",\"Scriptwriting & storyboarding\"]', 'https://img.freepik.com/free-vector/esport-game-streaming-abstract-concept-vector-illustration_335657-6368.jpg', 1, 'active', '2025-10-05 06:25:24', '2025-11-12 04:46:53'),
(2, 'Social Media Marketing (SSM) - Complete Management', 'social-media-marketing-ssm---complete-management', 'How We Help SaaS: Build brand authority, engage your target audience, nurture leads through educational content, and create community-driven growth that reduces customer acquisition costs.', 'fa-solid fa-share-nodes', '[\"Platform strategy & setup (LinkedIn\",\"Twitter\",\"Facebook\",\"Instagram)\",\"Content calendar creation & management\",\"Daily post creation & scheduling (20-30 posts\\/month)\",\"Community management & engagement\",\"social listening & competitor analysis\",\"Monthly performance reporting & optimization\",\"Paid social ad integration.\"]', 'https://img.freepik.com/free-vector/illustration-social-media-concept_53876-18311.jpg', 2, 'active', '2025-10-05 06:25:24', '2025-11-12 04:47:28'),
(3, 'PPC Advertising', 'ppc-advertising', 'We create cost-effective paid campaigns on Google and social platforms, targeting the right audience at the right time to maximize your return on investment.', 'fas fa-ad', '[\"Campaign Strategy & Budgeting\",\"Ad Copywriting & Creative Design\",\"Bid Management & Automation\",\"Audience Segmentation & Retargeting\",\"Shopping & Dynamic Ads\",\"A\\/B Testing & Conversion Tracking\",\"Programmatic Display & Native Ads\"]', '', 3, 'inactive', '2025-10-05 06:25:24', '2025-11-10 08:52:42'),
(4, 'Content Marketing', 'content-marketing', 'We craft compelling stories and valuable content that resonates with your audience, builds trust, and positions your brand as an industry leader', 'fas fa-pen-fancy', '[\"Editorial Strategy & Pillar-Cluster Planning\",\"Blog & Long-Form Article Production\",\"Video Production & YouTube Channel Management\",\"Podcast Creation & Distribution\",\"Infographics & Interactive Assets\",\"Whitepapers\",\"E-Books & Case Studies\",\"AI-Generated Content & Personalization\"]', 'https://nidmm.in/blog/wp-content/uploads/2023/09/Social-media-manager.png', 4, 'inactive', '2025-10-05 06:25:24', '2025-11-12 04:37:11'),
(5, 'Email Marketing', 'email-marketing', 'We design personalized email campaigns that nurture relationships, drive engagement, and convert subscribers into loyal customers through strategic messaging.', 'fas fa-envelope', '[\"Drip & Nurture Campaign Setup\",\"Segmentation & Dynamic Content\",\"Behavioral Trigger Workflows\",\"Deliverability Audits & List Hygiene\",\"A\\/B Testing & Performance Reporting\",\"SMS & Push Notification Integration\",\"AI-Powered Predictive Send Times\"]', 'https://manasissotechy.in/public/blogs/1089560834Best-Startup-Tools-1.png', 5, 'inactive', '2025-10-05 06:25:24', '2025-11-10 18:33:40'),
(6, 'Conversion Rate Optimization (CRO)', 'conversion-rate-optimization', 'We analyze user behavior and optimize your website experience to turn more visitors into customers, maximizing the value of your existing traffic.', 'fas fa-chart-line', '[\"Heatmaps & Session Recording Analysis\",\"User Journey Mapping\",\"Landing Page & Form Design\",\"A\\/B & Multivariate Testing\",\"Funnel Audit & Drop-Off Analysis\",\"Personalization & Recom\\u00admendation Engines\",\"Accessibility & Inclusive Design Tweaks\"]', '', 6, 'inactive', '2025-10-05 06:25:24', '2025-11-10 08:52:57'),
(8, 'Emerging and Experiential Digital', 'emerging-and-experiential-digital', 'We leverage cutting-edge technologies and immersive experiences to create memorable brand interactions that set you apart from competitors.', 'fa fa-brain', '[\"Augmented Reality Campaigns\\\"\",\"\\\"Voice & Smart Speaker Skill Development\\\"\",\"\\\"Metaverse Brand Experiences\\\"\",\"\\\"Chatbot & Conversational AI Flows\\\"\",\"\\\"Web3 & NFT-Based Marketing\\\"\",\"\\\"Interactive Live Video Commerce\"]', '', 8, 'inactive', '2025-10-17 05:35:21', '2025-11-10 08:52:55'),
(9, 'Analytics and Data Insights', 'analytics-and-data-insights', 'We transform raw data into actionable insights, helping you understand customer behavior and make informed decisions that drive business growth.', 'fa fa-database', '[\"Dashboard & Reporting Setup (GA4\",\"Data Studio)\",\"Customer Journey Attribution Modeling\",\"Predictive Analytics & Forecasting\",\"Cohort & LTV Analysis\",\"Real-Time Data Monitoring\",\"Data Governance & Compliance (GDPR\",\"CCPA)\"]', 'https://manasissotechy.in/public/blogs/1089560834Best-Startup-Tools-1.png', 9, 'inactive', '2025-10-17 05:36:25', '2025-11-10 18:30:20'),
